Дѝснейле́нд (англ. Disneyland, Disneyland Park) — парк развлечений в городе Анахайме (штат Калифорния, США), находящийся под управлением — подразделения компании «Уолт Дисней». Первый из тематических парков Уолта Диснея был открыт 17 июля 1955 года, став воплощением идеи Уолта Диснея о парке, в котором был бы воссоздан мир мультфильмов и сказок, где интересно всем: и взрослым, и детям. С момента создания был известен просто как «Диснейленд» (англ. Disneyland), но в 1998 году был переименован в «Парк Диснейленд» (англ. Disneyland Park), чтобы отличать от общего одноимённого , в состав которого, кроме парка, входят (англ. Disney's California Adventure Park) и (англ. Downtown Disney). Идея Диснейленда родилась у Уолта Диснея, когда он вместе с дочерьми посещал различные парки развлечений в 1930—1940-х годах. Изначально он планировал расположить аттракционы рядом со своей студией в Бербанке для развлечения фанатов созданных им мультфильмов их персонажами, но вскоре осознал, что предполагаемое место слишком маленькое. Наняв консультанта, Уолт Дисней в 1953 году приобрёл территорию в 160 акров (65 га) рядом с Анахаймом. В следующем же году стартовали строительные работы, и 17 июля 1955 года парк был торжественно открыт для посетителей. С момента открытия Диснейленд не раз расширялся и обновлялся. В частности, были добавлены: 
