* в 2001 году — на месте изначальной парковочной площадки Диснейленда был устроен (Disney California Adventure Park). Суммарное количество посетивших Диснейленд людей намного больше, чем в любом другом парке развлечений мира, — около 600 млн человек с момента его открытия. В 2009 году парк посетили 15,9 млн человек, тем самым Диснейленд стал в том году вторым по посещаемости в мире.
